import React from 'react';
import axios from 'axios';
import Navbar from '../components/Navbar';
import Grid from '@material-ui/core/Grid';
import Title from '../components/Title';
import back1 from '../UI Images/back1.jpg'


class MusicList extends React.Component {





    state = {
        music: []
    }

    componentDidMount() {
        axios.get('http://127.0.0.1:8000/api/')
            .then(res => {
                this.setState({
                    music: res.data
                });
                console.log(res.data)
            })
    };





    render() {
        return (
            <div class="container-fluid">
                <div class="jumbotron jumbotron-fluid text-light d-flex align-items-center" style={{ backgroundImage: 'url(' + back1 + ')', height: '100vh' }}>
                    <div class="container">
                        <h1 class="display-3">Ominus Beat</h1>
                        <p class="lead"> Add beat to your life</p>
                    </div>
                </div>
                <div class="container-fluid " style={{ backgroundImage: "url('https://picsum.photos/200')", height: 'auto' }}>
                    <h3 class="display-3 text-center text-light">Explore</h3>
                    <div class="row">
                        <div class="col-sm-6 p-5">
                            <img src="https://picsum.photos/200" className="img-thumbnail" />
                            <h5 class="text-light text-center">Rock</h5>
                        </div>
                        <div class="col-sm-6 p-5">
                            <img src="https://picsum.photos/200" className="img-thumbnail" />
                            <h5 class="text-light text-center">Rock</h5>
                        </div>
                    </div>
                    <div class="row">
                        <div class="col-sm-6 p-5">
                            <img src="https://picsum.photos/200" className="img-thumbnail" />
                            <h5 class="text-light text-center">Rock</h5>
                        </div>
                        <div class="col-sm-6 p-5">
                            <img src="https://picsum.photos/200" className="img-thumbnail" />
                            <h5 class="text-light text-center">Rock</h5>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default MusicList;
